import React from 'react';
import { Select } from './Select';
import { Name } from './Name';
import names from './names'

export class App extends React.Component {
   constructor(props){
     super(props)
     this.state ={
       name:'Cornelius'
     }
   }
    changeName=(newName)=>{
      this.setState({
        name:newName
      })
    }
  render() {
    return (
      <div>
        <Select changeName={this.changeName} />
        <Name name={this.state.name}/>
      </div>
    );
  }
}
